import { createAppContainer, createSwitchNavigator} from 'react-navigation'
import { createStackNavigator} from 'react-navigation-stack'
import SafeAreaView from 'react-native-safe-area-view';

import LoadingScreen from './screens/LoadingScreen'
import LoginScreen from './screens/LoginScreen'
import RegisterScreen from './screens/RegisterScreen'
import HomeScreen from './screens/HomeScreen'

import * as firebase from 'firebase'

var firebaseConfig = {
    apiKey: "AIzaSyCWeW-h0ZiyKQHydkZEbj1ZuR8J7rDiPoE",
    authDomain: "project-19-7fd3a.firebaseapp.com",
    databaseURL: "https://project-19-7fd3a.firebaseio.com",
    projectId: "project-19-7fd3a",
    storageBucket: "project-19-7fd3a.appspot.com",
    messagingSenderId: "218399817469",
    appId: "1:218399817469:web:37f58e4e0d1aff5c068894",
    measurementId: "G-R59XKV9PB3"
  };

firebase.initializeApp(firebaseConfig);

const AppStack = createStackNavigator({
    Home: HomeScreen
});

const AuthStack = createStackNavigator({
    Login: LoginScreen,
    Register: RegisterScreen
});

export default createAppContainer(
    createSwitchNavigator(
        {
            Loading: LoadingScreen,
            App: AppStack,
            Auth: AuthStack
        },
        {
            initialRouteName: "Loading"
        }
    )
);
